import Badge1IMG from "./circle check.svg";
import Badge2IMG from "./intel.svg";
import Badge3IMG from "./plusnotenote+.svg";
import Badge4IMG from "./house.svg";


export const Badges = () => {
  return (


<div className="mx-9 my-80-72">
  <div className="flex flex-wrap justify-center -mx-2">
    {/* Slim Badge 1 */}
    <div className="w-1/2 sm:w-1/4 p-2">
      <div className="bg-white rounded-lg shadow-md text-center p-3">
        <img src={Badge1IMG} alt="Icon 1" className="w-10 mx-auto" />
        <p className="text-xs mt-2">Guaranteed</p>
      </div>
    </div>

    {/* Slim Badge 2 */}
    <div className="w-1/2 sm:w-1/4 p-2">
      <div className="bg-white rounded-lg shadow-md text-center p-3">
        <img src={Badge2IMG} alt="Icon 2" className="w-10 mx-auto" />
        <p className="text-xs mt-2">Services</p>
      </div>
    </div>

    {/* Slim Badge 3 */}
    <div className="w-1/2 sm:w-1/4 p-2">
      <div className="bg-white rounded-lg shadow-md text-center p-3">
        <img src={Badge3IMG} alt="Icon 3" className="w-10 mx-auto" />
        <p className="text-xs mt-2">Availability</p>
      </div>
    </div>

    {/* Slim Badge 4 */}
    <div className="w-1/2 sm:w-1/4 p-2">
      <div className="bg-white rounded-lg shadow-md text-center p-3">
        <img src={Badge4IMG} alt="Icon 4" className="w-10 mx-auto" />
        <p className="text-xs mt-2">Based Here</p>
      </div>
    </div>
  </div>
</div>

  );
};
export default Badges;
